$(function(){_page.init()});var _page={init:function(){var n=new Vue({el:"#vue-users",data:{users:[]}});this.loadData(n)},loadData:function(n){var t=this;$.ajax({url:GlobalConfig.WebApi+"User/GetAllUsers",type:"GET",dataType:"json",xhrFields:{withCredentials:!0},crossdomain:!0,success:function(i){t.fillData(n,i)}})},fillData:function(n,t){for(var u,i=t.data,r=0;r<i.length;r++)u=i[r],u.LoginTimeStr=moment(u.LoginTime).format("YYYY-MM-DD HH:mm:ss");n.users=i}};